import {BrowserRouter, Routes, Route} from 'react-router-dom'

// Import Pages & Components
import Home from './pages/Home'
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div className='pages'>
        <Routes>
          <Route
            path = "/"
            elements = {<Home />}
          />
        </Routes>
      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
